      */}
      <div>Home</div>
      <div>
      <Link to="/createPost">Create Post</Link>
    </div>
      <h1>포스트</h1>
      <ul>
        {posts.map((post) => (
          <li key={post.id}>
            <h2>{post.title}</h2>
            <p>{post.content}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}


export default FetchPosts;
